export class TransactionInfo {
  transactionType;
  transactionId;
  transactionAmount;
  transactionFee;
  transactionConfirmedInBlock;
  transactionTimestamp;

  constructor(transactionType, transactionId, transactionAmount, transactionFee, transactionConfirmedInBlock, transactionTimestamp) {
    this.transactionType = transactionType;
    this.transactionId = transactionId;
    this.transactionAmount = transactionAmount;
    this.transactionFee = transactionFee;
    this.transactionConfirmedInBlock = transactionConfirmedInBlock;
    this.transactionTimestamp = transactionTimestamp;
  }

}
